               </div>
             </div>

          </div>
    </div>
  </div>
</template>
<script>


export default {
  name: "CardComponent",
  data() {
    return {
      selectedTeethList: [],
      babyTeethShow: false,
      adultToothOpacity: '',
      descriptions: {},
      over: {},
      startLoc: 0,
      dragging: false,
      dragFrom: {},
      newDescription: ''
    }
  },
  mounted() {
    this.adultToothOpacity = 'opacity:1.0'
  },
  methods: {
    addNewDescription(teeth_id){
      console.log(this.descriptions[teeth_id])
    },
    startDrag(item, i, e) {
      this.startLoc = e.clientY;
      this.dragging = true;
      this.dragFrom = item;
    },
    finishDrag(item, pos) {
      this.selectedTeethList.splice(pos, 1)
      this.selectedTeethList.splice(this.over.pos, 0, item);
      this.over = {}
    },

    onDragOver(item, pos, e) {
      const dir = (this.startLoc < e.clientY) ? 'down': 'up';
      setTimeout(() => {
        this.over = { item, pos, dir };
      }, 50)

    },
    checkAdultToothViewState(){
      if(this.babyTeethShow){
        this.adultToothOpacity = 'opacity:0.2'
      }
    },
    showAdultTooth(){
      this.adultToothOpacity = 'opacity:1.0'
    },
    babyTeethViewStatus(){
      this.babyTeethShow = !this.babyTeethShow
      if(this.babyTeethShow){
        this.adultToothOpacity = 'opacity:0.2'
      }else{
        this.adultToothOpacity = 'opacity:1.0'
      }
    },
    addToList(id) {
      if (this.selectedTeethList.includes(id)) {
        this.selectedTeethList = this.selectedTeethList.filter(item => item !== id)
        delete this.descriptions[id];
      } else {
        this.selectedTeethList.push(id)
        this.descriptions[id] = ''
      }

    }
  }
}
</script>

